import React from 'react';
import './feed.css';

function Feed() {
  // Content of your feed goes here
  return (
    <div className="feed">
      <div className="post">
        <h2>Post 1</h2>
        <p>This is the first post.</p>
      </div>
      <div className="post">
        <h2>Post 2</h2>
        <p>This is the second post.</p>
      </div>
      {/* Add more posts as needed */}
    </div>
  );
}

export default Feed;
